window.bookSummaryJSON = "<p><b>Over a peanut butter and jelly sandwich in the second grade, I gave Wren Tyler my heart. </b></p> <p>I never wanted it back, even when time, distance, and fate kept us apart—because even as a kid, I knew I'd love that girl forever. </p> <p>It’s not until years later that we finally have a chance to be together. </p> <p><i>Finally. </i></p> <p>I’ve waited patiently through every obstacle and impossibility, and nothing is going to mess up my chance at a future with Wren. </p> <p>Unfortunately, my vengeful ex-fiancée has other plans. </p> <p>Already embroiled in a battle for my business, my ex sets her sights on Wren. <br> She slings lies and threats like well-aimed arrows, intent on ruining me and destroying the woman I love. </p> <p>Each attack tests our newfound love, and instead of weathering the storm… </p> <p><i>Wren might just decide I'm not worth the risk.</i></p>"; 
